pub fn getSprite(name: []const u8, shiny: bool) ?[]const u8 {
    const sprites = if (shiny) shiny_sprites else regular_sprites;
    for (sprites) |sprite| {
        if (std.mem.eql(u8, sprite.name, name)) {
            return sprite.data;
        }
    }
    return null;
}
